import React, { useState } from "react";
import styles from "./Projects.module.css";

export default function Projects() {
  const [selectedProject, setSelectedProject] = useState(null);

  const toggleProjectDetails = (projectId) => {
    setSelectedProject(selectedProject === projectId ? null : projectId);
  };

  const projects = [
    {
      id: "piscinas",
      title: "Landing Page - Tratador de Piscinas",
      description: "Site para promover serviços de manutenção de piscinas.",
      features: [
        "Serviços oferecidos.",
        "Benefícios da manutenção.",
        "Formulário de contato.",
        "Carrossel de imagens.",
        "Links para redes sociais.",
      ],
      technologies: ["JavaScript", "HTML", "CSS", "Bootstrap"],
      links: {
        project: "https://www.gjpiscinaesaude.com.br/",
        repository: "https://github.com/nayarakarinearaujo/gj.piscinaesaude",
      },
    },
    {
      id: "tecnico",
      title: "Projeto - Landing Page Técnico de Eletrodoméstico",
      description:
        "Este site foi desenvolvido para uma empresa especializada em conserto e vendas de eletrodomésticos, oferecendo serviços de alta qualidade e atendimento excepcional.",
      features: [
        "Menu de Navegação: Facilita a navegação entre as seções do site.",
        "Seção Sobre: Informações sobre a empresa e sua missão.",
        "Seção de Serviços: Descrição detalhada dos serviços oferecidos, incluindo higienização e conserto de eletrodomésticos.",
        "Seção de Benefícios: Lista dos principais benefícios oferecidos pela empresa.",
        "Seção de Contato: Formulário para que os clientes possam entrar em contato facilmente.",
        "Seção de Produtos em Destaque: Apresenta os produtos disponíveis para venda.",
      ],
      technologies: ["JavaScript", "HTML", "CSS"],
      links: {
        project: "https://itamar-eletrohelp.vercel.app/",
        repository: "https://github.com/nayarakarinearaujo/itamar.eletrohelp",
      },
    },
    {
      id: "formularioDev",
      title: "Projeto - Formulário de Devs",
      description:
        "Esse projeto é um formulário de cadastro para desenvolvedores, cujo objetivo é coletar informações para recrutamento ou análise de habilidades.",
      features: [
        "Formulário de Cadastro: O projeto apresenta um formulário para os desenvolvedores preencherem suas informações.",
        "Seleção de Tecnologias: Permite que os desenvolvedores selecionem as tecnologias que dominam.",
        "Validação de Campos: Realiza validações nos campos para garantir dados adequados.",
        "Estilização Visual: Utiliza CSS para fornecer uma aparência agradável ao formulário.",
      ],
      technologies: ["HTML", "CSS"],
      links: {
        project: "https://projeto-formulario-six.vercel.app/",
        repository:
          "https://github.com/nayarakarinearaujo/projeto-formulario-devs",
      },
    },
    {
      id: "decodificador",
      title: "Projeto - Decodificador de texto",
      description:
        "Neste projeto, é possível criptografar e descriptografar textos de acordo com regras específicas.",
      features: [
        "Criptografia: A letra 'e' é convertida para 'enter', 'i' para 'imes', 'a' para 'ai', 'o' para 'ober', 'u' para 'ufat'.",
        "Descriptografia: Converte uma palavra criptografada para sua versão original.",
      ],
      technologies: ["JavaScript", "HTML", "CSS", "Figma"],
      links: {
        project: "https://challenge-one-01.vercel.app/",
        repository:
          "https://github.com/nayarakarinearaujo/challenge-one-01/blob/main/README.md",
      },
    },
    {
      id: "jogo",
      title: "Projeto - Jogo do Número Secreto",
      description:
        "Esse projeto é um jogo simples onde você tenta adivinhar um número entre 1 e 10.",
      features: [
        "Geração de Número Aleatório: O jogo gera um número aleatório entre 1 e 10.",
        "Interação com o Usuário: O jogador insere sua suposição e clica no botão para verificar se está correto.",
        "Feedback Instantâneo: Fornece feedback indicando se o número é maior, menor ou igual ao número secreto.",
        "Reinicialização do Jogo: O jogador pode reiniciar o jogo a qualquer momento.",
      ],
      technologies: ["JavaScript", "HTML", "CSS"],
      links: {
        project: "https://jogo-five-dun.vercel.app/",
        repository:
          "https://github.com/nayarakarinearaujo/jogo-do-numero-secreto",
      },
    },
    {
      id: "todoList",
      title: "Projeto - To Do List",
      description:
        "Uma aplicação de lista de tarefas com React, onde os usuários podem gerenciar tarefas diárias, adicionando, completando e removendo tarefas.",
      features: [
        "Adicionar Tarefas: Permite criar novas tarefas com título e categoria.",
        "Completar Tarefas: Marca tarefas como concluídas ou não.",
        "Remover Tarefas: Remove tarefas da lista.",
        "Filtrar Tarefas: Filtra tarefas por status (Todas, Concluídas, Incompletas).",
        "Pesquisar Tarefas: Pesquisa tarefas pelo título.",
        "Ordenar Tarefas: Ordena as tarefas em ordem ascendente ou descendente.",
      ],
      technologies: ["React", "CSS"],
      links: {
        project: "https://nayarakarinearaujo.github.io/TodoListReact/",
        repository: "https://github.com/nayarakarinearaujo/ToDoList-React",
      },
    },
    // Adicione mais projetos aqui
  ];

  return (
    <div className={styles.projects_container}>
      <h1>Projetos</h1>

      <section id="front-end">
        <h2>Projetos de Front-end</h2>
        <div className={styles.projects_grid}>
          {projects.map((project) => (
            <div
              key={project.id}
              className={styles.project_card}
              onClick={() => toggleProjectDetails(project.id)}
            >
              <div className={styles.project_info}>
                <h3>{project.title}</h3>
                <p>{project.description}</p>
              </div>
              {selectedProject === project.id && (
                <div className={styles.project_details}>
                  <h4>💡 Funcionalidades Principais:</h4>
                  <ul>
                    {project.features.map((feature, index) => (
                      <li key={index}>{feature}</li>
                    ))}
                  </ul>
                  <h4>🛠️ Tecnologias Utilizadas:</h4>
                  <ul>
                    {project.technologies.map((tech, index) => (
                      <li key={index}>{tech}</li>
                    ))}
                  </ul>
                  <p>
                    <a
                      href={project.links.project}
                      target="_blank"
                      rel="noopener noreferrer"
                    >
                      Link do Projeto
                    </a>
                  </p>
                  <p>
                    <a
                      href={project.links.repository}
                      target="_blank"
                      rel="noopener noreferrer"
                    >
                      Link do Repositório
                    </a>
                  </p>
                </div>
              )}
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}
